// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract LiquidityPoolFactory is Ownable {
    struct PoolInfo {
        address poolAddress;
        address tokenA;
        address tokenB;
    }

    PoolInfo[] public pools;
    uint256 public poolCreationFee;

    event PoolCreated(address indexed poolAddress, address indexed tokenA, address indexed tokenB);

    /**
     * @dev Constructor that sets the initial pool creation fee and initializes Ownable.
     * @param _poolCreationFee The fee required to create a new liquidity pool.
     */
    constructor(uint256 _poolCreationFee) Ownable(msg.sender) {
        poolCreationFee = _poolCreationFee;
    }

    /**
     * @dev Allows the owner to update the pool creation fee.
     * @param _poolCreationFee The new pool creation fee.
     */
    function setPoolCreationFee(uint256 _poolCreationFee) external onlyOwner {
        poolCreationFee = _poolCreationFee;
    }

    /**
     * @dev Creates a new liquidity pool for a pair of tokens.
     * @param _tokenA Address of the first token.
     * @param _tokenB Address of the second token.
     */
    function createPool(address _tokenA, address _tokenB) external payable returns (address) {
        require(msg.value >= poolCreationFee, "Insufficient pool creation fee");
        require(_tokenA != _tokenB, "Tokens must be different");

        LiquidityPool newPool = new LiquidityPool(_tokenA, _tokenB);
        pools.push(PoolInfo(address(newPool), _tokenA, _tokenB));

        payable(owner()).transfer(msg.value); // Transfer the pool creation fee to the contract owner

        emit PoolCreated(address(newPool), _tokenA, _tokenB);
        return address(newPool);
    }

    function getPoolsCount() external view returns (uint256) {
        return pools.length;
    }
}

contract LiquidityPool {
    IERC20 public tokenA;
    IERC20 public tokenB;

    uint256 public totalTokenA;
    uint256 public totalTokenB;

    mapping(address => uint256) public liquidity;

    event LiquidityAdded(address indexed provider, uint256 amountA, uint256 amountB, uint256 liquidity);
    event LiquidityRemoved(address indexed provider, uint256 amountA, uint256 amountB, uint256 liquidity);

    constructor(address _tokenA, address _tokenB) {
        tokenA = IERC20(_tokenA);
        tokenB = IERC20(_tokenB);
    }

    function addLiquidity(uint256 amountA, uint256 amountB) external {
        require(amountA > 0 && amountB > 0, "Amounts must be greater than zero");

        tokenA.transferFrom(msg.sender, address(this), amountA);
        tokenB.transferFrom(msg.sender, address(this), amountB);

        uint256 liquidityTokens;
        if (totalTokenA == 0 && totalTokenB == 0) {
            liquidityTokens = amountA + amountB;
        } else {
            liquidityTokens = (amountA * totalTokenA) / totalTokenB;
        }

        totalTokenA += amountA;
        totalTokenB += amountB;
        liquidity[msg.sender] += liquidityTokens;

        emit LiquidityAdded(msg.sender, amountA, amountB, liquidityTokens);
    }

    function removeLiquidity(uint256 liquidityAmount) external {
        require(liquidity[msg.sender] >= liquidityAmount, "Not enough liquidity");

        uint256 amountA = (liquidityAmount * totalTokenA) / liquidity[msg.sender];
        uint256 amountB = (liquidityAmount * totalTokenB) / liquidity[msg.sender];

        liquidity[msg.sender] -= liquidityAmount;
        totalTokenA -= amountA;
        totalTokenB -= amountB;

        tokenA.transfer(msg.sender, amountA);
        tokenB.transfer(msg.sender, amountB);

        emit LiquidityRemoved(msg.sender, amountA, amountB, liquidityAmount);
    }

    function getReserves() external view returns (uint256, uint256) {
        return (totalTokenA, totalTokenB);
    }
}

